import React from 'react'
import { Navbar, Container, Nav } from 'react-bootstrap'
import { NavLink } from 'react-router-dom'

const Links = (auth) => {
    if (auth)
        return (
            <Nav className="me-auto">
                <Nav.Link as={NavLink} to="/login" exact >
                    Login
                                </Nav.Link>
                <Nav.Link as={NavLink} to="/register" exact >
                    Register
                </Nav.Link>
            </Nav>
        )
    else return (
        <Nav className="me-auto">
            <Nav.Link as={NavLink} to="/login" exact >
                Servers
            </Nav.Link>
        </Nav>
    )
}

function TopBar({ auth, setAuth }) {
    console.log(auth, setAuth);
    const connect = () => {
        setAuth({
            username: 'achraf',
            password: 'achraf'
        })
    }
    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <Navbar.Text onClick={connect}>
                    authenticate
                </Navbar.Text>
                <Navbar.Brand >
                    <Nav.Link as={NavLink} to={auth ? '/' : '/login'} exact >
                        {auth ? 'Home' : 'Login'}
                    </Nav.Link>
                </Navbar.Brand>
                <Links auth={auth} />
            </Container>
        </Navbar>
    )
}

export default TopBar
